import React from "react";
const ProductsListasadmin = (props) => {
  return (
    <div>
      <div className="products-details">
        {props.data.map((e, i) => {
          return (
            <div class="card">
              <div class="card-border-top"></div>
              <div>
                <img
                  class="img"
                  src={e.imageUrl}
                  onClick={() => props.detail(e)}
                />
              </div>
              <span> {e.name}</span>
              <p class="job"> {e.price}</p>
              <button
                onClick={() => {
                  props.setElement(e);
                  props.switchView("updateproject");
                }}
                class="noselect"
              >
                <span class="text">Delete</span>
                <span class="icon">
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="24"
                    height="24"
                    viewBox="0 0 24 24"
                  >
                    <path d="M24 20.188l-8.315-8.209 8.2-8.282-3.697-3.697-8.212 8.318-8.31-8.203-3.666 3.666 8.321 8.24-8.206 8.313 3.666 3.666 8.237-8.318 8.285 8.203z"></path>
                  </svg>
                </span>
                update
              </button>
              <button
                onClick={() => {
                  props.deleteProduct(e);
                }}
              >
                delete
              </button>
            </div>
          );
        })}
        <br />
      </div>
      <div className="divaddbutton">
        <button
          className="addbutton"
          onClick={() => {
            props.switchView("addproduct");
          }}
        >
          ADD Prduct
        </button>
      </div>
    </div>
  );
};
export default ProductsListasadmin;
